import React from 'react';
import logo from './logo.svg';
import logo1 from './logo_oficial.png' // relative path to image 
import './App.css';

function App() {
  return (
    <div className="App">
      <a href="#">
        <img src={logo1} className="logo" alt="logo" width="45px" height="45px" />
        lue Shopping
      </a>
      <nav>
        <ul>
          <li><a href="#" id="href">Tienda</a></li>
          <li><a href="#" id="href">Registrate</a></li>
          <li><a href="#" id="href">Iniciar sesion</a></li>
        </ul>
      </nav>


    </div>
  );
}

export default App;
